sdfsdfs示例：<code>
  &amp;lt;root value=&quot;abc&quot;&amp;gt;
         &amp;lt;item value=&quot;item0&quot;/&amp;gt;
         &amp;lt;item value=&quot;item1&quot;/&amp;gt;
  &amp;lt;/root&amp;gt;
</code>将解析为:<code>
    {
         &quot;name&quot;: &quot;root&quot;,
         &quot;$value&quot;: &quot;abc&quot;,
         &quot;children&quot;: [
             {&quot;name&quot;: &quot;item&quot;, &quot;$value&quot;: &quot;item0&quot;},
             {&quot;name&quot;: &quot;item&quot;, &quot;$value&quot;: &quot;item1&quot;}
         ]
     }
</code>
